export const NodeService = {
    getTreeNodes: () => {
        return Promise.resolve([
            { label: 'Documents', children: [{ label: 'Work' }, { label: 'Personal' }] },
            { label: 'Pictures', children: [{ label: 'Vacation' }, { label: 'Family' }] }
        ]);
    }
};
